import React from "react";

function IncrementDecrementButton({duration, disable, value, name, spanClass}) {
    return (
      <button
        type="button"
        className="btn btn-primary"
        data-testid="decrease-focus"
        onClick={duration}
        disabled={disable}
        name={name}
        value={value}
      >
        <span className={spanClass} />
      </button>
    )
}

export default IncrementDecrementButton;
